import MainNavigation from './components/layout/MainNavigation';

function App() {
  return (
    <div>
      {//localhost:3000
      }
      <MainNavigation />
      <Routes>
      <Route path='' exact>
        <AllMeetupsPage />
      </Route>
      <Route path='/new-meetup'>
      <NewMeetupPage />
    </Route>
    <Route path='/favorites'>
        <FavoritesPage />
      </Route>
      </Routes>
    </div>);
}

export default App;
